import React, { useRef } from "react";
import { useGLTF } from "@react-three/drei";
import { Canvas, useFrame } from "@react-three/fiber";
import { MeshOutline } from "@react-three/drei";

const shapes = require("../../assets/3dModels/backgroundShapes.gltf");

export function Model(props) {
  const { nodes, materials } = useGLTF(shapes);
  const groupRef = useRef();

  useFrame(() => {
    groupRef.current.rotation.y += 0.005;
  });

  return (
    <group position={[0, 0, 3]} {...props} dispose={null}>
      <MeshOutline
        args={[nodes.Cube.geometry, 0x000000]}
        position={[-1.59, 0.8, -0.09]}
        rotation={[-0.26, 0.43, 0.58]}
        scale={0.27}
      >
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube.geometry}
          material={materials["Material.002"]}
        />
      </MeshOutline>
      <MeshOutline
        args={[nodes.Cube001.geometry, 0x000000]}
        position={[1.68, 0.22, 0.51]}
        rotation={[0.14, -0.61, 0.24]}
        scale={0.26}
      >
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube001.geometry}
          material={materials["Material.003"]}
        />
      </MeshOutline>
      <MeshOutline
        args={[nodes.Roundcube.geometry, 0x000000]}
        position={[-0.67, -0.78, 0]}
        scale={0.28}
      >
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Roundcube.geometry}
          material={materials["Material.003"]}
        />
      </MeshOutline>
      <MeshOutline
        args={[nodes.Cube002.geometry, 0x000000]}
        position={[-0.96, -0.59, -0.72]}
        rotation={[-0.31, 0.09, 0.68]}
        scale={[0.63, 0.09, 0.11]}
      >
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube002.geometry}
          material={materials["Material.005"]}
        />
      </MeshOutline>
      <MeshOutline
        args={[nodes.Cube003.geometry, 0x000000]}
        position={[-2.08, 0.7, -0.49]}
        rotation={[-0.27, 0.44, 0.58]}
        scale={0.27}
      >
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube003.geometry}
          material={materials["Material.003"]}
        />
      </MeshOutline>
      <MeshOutline
        args={[nodes.Cube004.geometry, 0x000000]}
        position={[0.23, 0.5, -0.28]}
        rotation={[2.28, -0.63, 2.04]}
        scale={0.18}
      >
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube004.geometry}
          material={materials["Material.002"]}
        />
      </MeshOutline>
    </group>
  );
}

export default function BackgroundShapes() {
  return (
    <Canvas>
      <ambientLight />
      <pointLight position={[10, 10, 10]} />
<Model />
</Canvas>
);
}
